    "Characteristics, trapping techniques and views of trappers on a wildlife refuge
    in Alaska",nt"tracking_summary": {ntt"total": 12,ntt"recent": 0nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-07-27T23:02:22.994405",nt"name":
    "characteristics-trapping-techniques-and-views-of-trappers-on-a-wildlife-refuge-in-alaska",nt"isopen":
    false,nt"url": null,nt"notes": "Persons requesting permits to trap on a
    691,000 ha wildlife refuge on Alaska's Kenai Peninsula answered questions about
    their trapping experience, trapping techniques, and views on trapping on the refuge
    and its impacts. Fifty-one percent did not have any trapping experience outside
    of Alaska and 24 percent had not previously trapped. Only 21 percent had over 10
    years of experience trapping in the state. Outdoor experience was the main reason
    for trapping, most trappers trapped for land as well as aquatic furbearers, and
    the wolf, coyote, and wolverine were considered the most difficult to trap. Forty-five
    percent did not previously trap on the refuge. Only 32 percent favored changing
    trapping procedures despite the fact that only 39 percent reported they had no significant
    problems trapping on the refuge. Interference by non-trappers and stolen traps were
    reported by over 25 percent of the respondents. The majority of trappers indicated
    they would support additional regulations or closed areas to protect furbearers.
    Of those trappers who felt high prices were contributing to excessive trapping pressure
    on long-haired furbearers, most listed the lynx as the most vulnerable species.",nt"license_title":
